import { Summary } from "../Summary";
import { Transactionstable } from "../TransactionsTable";

import iconSun from '../../assets/iconSun.sv'

import { Container } from "./styles";

interface DashboardProps {
    onThemeTooggle: () => void;
    stateTheme: string;
}

export function Dashboard({ onThemeTooggle, stateTheme }: DashboardProps) {
    return (
        <Container>
            <Summary />
            <Transactionstable />
            <button onClick={() => onThemeTooggle()}>{stateTheme === 'ligth'}? <img src={iconSun} alt="icon do sol" />:<img src={iconMoon} alt="icon da lua" /></button>
        </Container>
    )
}
